    var i, tabviz,  tablinks;

    for (i = 0; i < tabviz.length; i++) {

    }

    for (i = 0; i < tablinks.length; i++) {

    }

    document.getElementById(tabName).style.display = "block";

    elmnt.classList.add('button-outline');
}
